import collections
import sys

from submit_answer import submit_answer


sys.setrecursionlimit(1_000_000)


#      N   E   S   W
chr = [-1, 0,  1,  0, -1, -1,  1,  1]
chc = [0,  1,  0, -1, -1,  1, -1,  1]


LEVEL = 2
SAMPLE_ANSWERS = [94, 154]
SAMPLE_ANSWER = SAMPLE_ANSWERS[LEVEL - 1]


def solve(input_string: str) -> int or str:
    # A = list(input_string)
    # A = list(map(int, input_string.split(',')))
    A = [list(line) for line in input_string.split('\n')]
    # A = [int(line) for line in input_string.split('\n')]
    # A = [list(map(int, line.split())) for line in input_string.split('\n')]

    N = len(A)
    M = len(A[0])
    print("N =", N)
    print("M =", M)
    print(A[:10])

    sr = 0
    sc = A[0].index('.')


    def end_blocked(row, col):
        q = collections.deque()
        q.append((row, col))
        visited = set()
        visited.add((row, col))
        while q:
            r, c = q.popleft()
            if r == N - 1:
                return False
            for d in range(4):
                nr = r + chr[d]
                nc = c + chc[d]
                if 0 <= nr < N and 0 <= nc < M and (nr, nc) not in visited and A[nr][nc] != '#':
                    q.append((nr, nc))
                    visited.add((nr, nc))
        return True

    def dfs(row, col, n, block):
        if not (0 <= row < N and 0 <= col < M) or A[row][col] == '#':
            return -1

        if row == N - 1:
            if n >= 5800:
                print(n)
            return n
        # print(row, col, n, block)
        if n % 10 == 0 and block and end_blocked(row, col):
            return -1

        val = A[row][col]
        A[row][col] = '#'

        if LEVEL == 1 and val in "^>v<":
            d = "^>v<".index(val)
            ret = dfs(row + chr[d], col + chc[d], n + 1, False)
        else:
            adj = [
                '#' if not (0 <= row - 1 < N and 0 <= col < M) else A[row - 1][col],
                '#' if not (0 <= row < N and 0 <= col + 1 < M) else A[row][col + 1],
                '#' if not (0 <= row + 1 < N and 0 <= col < M) else A[row + 1][col],
                '#' if not (0 <= row < N and 0 <= col - 1 < M) else A[row][col - 1],
            ]
            # if adj.count('#') < 3 and row < 50:
            #     print(row, col, adj.count('#'))
            check_block = adj.count('#') < 3
            ret = max(
                dfs(row - 1, col, n + 1, check_block),
                dfs(row, col + 1, n + 1, check_block),
                dfs(row + 1, col, n + 1, check_block),
                dfs(row, col - 1, n + 1, check_block)
            )
        A[row][col] = val

        return ret
    ans = dfs(sr, sc, 0, False)
    return ans


def main():
    with open("sample.txt") as sample_file:
        sample_input = sample_file.read().strip('\n')
    sample_answer = solve(sample_input)
    print("Answer for sample:", sample_answer)
    assert sample_answer == SAMPLE_ANSWER and sample_answer is not None, f"Got {sample_answer} instead of {SAMPLE_ANSWER}"

    with open("input.txt") as input_file:
        inp = input_file.read().strip('\n')
    answer = solve(inp)
    print("Answer:", answer)
    assert submit_answer(2023, 23, LEVEL, answer) is True


if __name__ == '__main__':
    main()


